import Expenses from "./components/Expenses";

function App() {
  // const parag = document.createElement('p')
  // parag.textContent ='This is also visible!'
  // document.getElementById('root').append(parag);
  //4,5 ve 6. satirlarda yazan kismi alt tarafta html kodu olarak <p>This is also visible!</p> sekilde yazabiliyoruz
  const expenses = [
    {id:'e1',title:'Car Insurance', amount:220.73, date:new Date(2022, 3, 1)},
    {id:'e2',title:'New TV', amount:350.36, date:new Date(2022, 2, 1)},
    {id:'e3',title:'Motorbike', amount:9220.73, date:new Date(2022, 5, 1)},
    {id:'e4',title:'Phone', amount:1220.73, date:new Date(2022, 4, 1)}
  ]

  return (
    <div>
      <h2>Let's get started!</h2>
      <Expenses items={expenses} />
    </div>
  );
}

export default App;
